/**
 * 按时间分组 (矩阵转换)
 * [                     [
 *  [3, 2, 1]     转为    [3, 3, 3]
 *  [3, 2, 1]             [2, 2, 2]
 *  [3, 2, 2]             [1, 1, 1]
 * ]                     ]
 */

function groupByTime(data){
    const resData = [];
    const width = data[0].length; //矩阵宽度
    for (let i=0; i<width; i++) {
        const currentColumns = []; //当前列
        data.forEach(row => {
            row[i] && currentColumns.push(row[i]);
        });
        resData.push(currentColumns);
    }
    return resData;
}


